    methods
        %% constructor
        function this = classCleanupFilterWrapper(parent)
            this.Parent = parent;
            this.TemplatePanel = imread('Microscope_Control_Panel.tif');
        end %fun
        
        function initialize(this)
            get_panel(this);
        end %fun
        
        %% getter
        function get_panel(this)
            screenShot = rgb2gray(get_screen_shot);
            
            corrMap = normxcorr2(this.TemplatePanel, screenShot);
            [valMaxCorr, posMaxCorr] = max(corrMap(:));
            
            if valMaxCorr < 0.7
                this.PanelPos = [];
                this.ObsPanel = [];
                fprintf('\nCleanup Filter Control Panel not detectable.\n')
            else %panel was identified
                [i0,j0] = ind2sub(size(corrMap),posMaxCorr(1));
                panelHeight = size(this.TemplatePanel,1);
                i0 = i0-panelHeight;
                panelWidth = size(this.TemplatePanel,2);
                j0 = j0-panelWidth;
                
                this.PanelPos = [j0+1,i0+1,panelWidth+48,panelHeight+31];
                this.ObsPanel = screenShot(i0+1:i0+panelHeight+31,j0+1:j0+panelWidth+48,:);
                %             figure;imagesc(screenShot); colormap gray; hold on; plot(j0,i0,'rx')
            end %if
        end %fun
        function update_panel(this)
            if isempty(this.PanelPos)
                get_panel(this)
                return
            end %if
            
            this.ObsPanel = rgb2gray(get_screen_shot(this.PanelPos));
            
            %check consistency (in case the panel was moved)
            templatePanel = double(this.TemplatePanel);
            obsPanel = double(this.ObsPanel(1:end-31,1:end-48));
            
            numTemplate = numel(templatePanel);
            muTemplate = sum(sum(sum(templatePanel)))/numTemplate;
            ssTemplate = sum(sum(sum(templatePanel.^2)));
            muObs = sum(sum(sum(obsPanel)))/numTemplate;
            ssObs = sum(sum(sum(obsPanel.^2)));
            
            CC = (sum(sum(sum(templatePanel.*obsPanel)))-numTemplate*muTemplate*muObs)/...
                (sqrt(ssTemplate-numTemplate*muTemplate^2)*sqrt(ssObs-numTemplate*muObs^2));
            
            if CC < 0.8
                get_panel(this)
            end %if
        end %fun
        
        function [state,ctrDropdown] = get_cleanup_filter_set(this)
            update_panel(this)
            
            obsDropdown = this.ObsPanel(56:end,10:end,:);
            ctrDropdown = [33,68];
            
            state = get_Dropdown_state(this,obsDropdown);
        end %fun
        
        %% setter
        function set_cleanup_filter_set(this,filterSet)
            [currentSet,ctrDropdown] = get_cleanup_filter_set(this);
            if filterSet == currentSet
                %no change in current state
                return
            end %if
            
            %save current mouse position
            screenSize = get(0,'ScreenSize');
            currentMousePos = get(0,'PointerLocation');
            currentMousePos(2) = screenSize(4) - currentMousePos(2) + 1;
            
            import java.awt.event.*;
            xCtrToggle = this.PanelPos(1)+ctrDropdown(1);
            yCtrToggle = this.PanelPos(2)+ctrDropdown(2);
            this.Parent.JavaRobot.mouseMove(xCtrToggle, yCtrToggle);
            this.Parent.JavaRobot.mousePress(InputEvent.BUTTON1_MASK);
            this.Parent.JavaRobot.mouseRelease(InputEvent.BUTTON1_MASK);
            switch filterSet
                case 1
                    this.Parent.JavaRobot.mouseMove(xCtrToggle, yCtrToggle + 14);
                case 2
                    this.Parent.JavaRobot.mouseMove(xCtrToggle, yCtrToggle + 28);
                case 3
                    this.Parent.JavaRobot.mouseMove(xCtrToggle, yCtrToggle + 42);
                case 4
                    this.Parent.JavaRobot.mouseMove(xCtrToggle, yCtrToggle + 56);
                case 5
                    this.Parent.JavaRobot.mouseMove(xCtrToggle, yCtrToggle + 70);
                otherwise
                    fprintf('\nExpected Input: \n1 ==> 445/45(Dapi,BFP) \n2 ==> 525/50(GFP) \n3 ==> 600/37(TMR,mCherry) \n4 ==> 697/58(Cy5,Atto655) \n5 ==> Empty\n')
                    return
            end %switch
            this.Parent.JavaRobot.mousePress(InputEvent.BUTTON1_MASK);
            this.Parent.JavaRobot.mouseRelease(InputEvent.BUTTON1_MASK);
            
            %restore current mouse position
            newMousePos = get(0,'PointerLocation');
            newMousePos(2) = screenSize(4) - newMousePos(2) + 1;
            
            dr = newMousePos - currentMousePos;
            this.Parent.JavaRobot.mouseMove(xCtrToggle-dr(1), yCtrToggle-dr(2));
            
            pause(0.5)
        end %fun
        
        %%
        function stateDropdown = get_Dropdown_state(this,obsDropdown)
            sseEmpty = sum((obsDropdown(:)-this.TemplateDropdownEmpty(:)).^2);
            sse445_45 = sum((obsDropdown(:)-this.TemplateDropdown445_45(:)).^2);
            sse525_50 = sum((obsDropdown(:)-this.TemplateDropdown525_50(:)).^2);
            sse600_37 = sum((obsDropdown(:)-this.TemplateDropdown600_37(:)).^2);
            sse697_58 = sum((obsDropdown(:)-this.TemplateDropdown697_58(:)).^2);
            
            critSSE = 0;
            if min([sseEmpty sse445_45 sse525_50 sse600_37 sse697_58]) > critSSE
                fprintf('\nError in identification of cleanup filter dropdown state!\n')
                stateDropdown = [];
            else
                if sseEmpty == min([sseEmpty sse445_45 sse525_50 sse600_37 sse697_58])
                    stateDropdown = 5;
                elseif sse445_45 == min([sseEmpty sse445_45 sse525_50 sse600_37 sse697_58])
                    stateDropdown = 1;
                elseif sse525_50 == min([sseEmpty sse445_45 sse525_50 sse600_37 sse697_58])
                    stateDropdown = 2;
                elseif sse600_37 == min([sseEmpty sse445_45 sse525_50 sse600_37 sse697_58])
                    stateDropdown = 3;
                elseif sse697_58 == min([sseEmpty sse445_45 sse525_50 sse600_37 sse697_58])
                    stateDropdown = 4;
                else
                    fprintf('\nError in identification of cleanup filter dropdown state!\n')
                    stateDropdown = [];
                end %if
            end %if
        end %fun
    end %methods
end %classdef

